title: རྒྱ་བཞི་ཆོ་ག་མདོ་སྔགས་ཟུང་འཇུག་གི་ལུགས། དངོས་ཀྱི་བརྒྱ་བཞི་རྒྱས་བསྡུས་གཉིས།
  གཟུགས་བརྙན་གྱི་བརྒྱ་བཞི་རྒྱས་བསྡུས་གཉིས། ཏིང་ངེ་འཛིན་གྱི་བརྒྱ་བཞི་དང་ལྔ་ཡི་ཕྱག་ལེན་འདོན་ཆ་འགྲིགས་ཆོག་ཏུ་བཀོད་པ།
